import React from 'react';
import axios from 'axios';

import * as config from "../services/config";
import UserAccountTable from '../components/UserAccountsTable';
import AddNewAccountButton from "../components/AddNewAccountButton";
import AddNewDialog from "../components/AddNewDialog";

class Main extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            users: [],
            showModal: false
        };
    }

    componentDidMount() {
        axios.get(config.userAccountManagementBackendUrl)
            .then(res => {
                console.log(res.data);
                this.setState({
                    users: res.data
                });

            }).catch((err) => {
            console.log(err)
        });
    }

    render() {
        const users = this.state.users;
        return (
            <div>
                <h3>User Account Management</h3>
                <AddNewAccountButton onClick={() => this.setState({showModal: true})}/>
                <AddNewDialog/>
                <UserAccountTable users={users}></UserAccountTable>
            </div>
        )
    }

}

export default Main;
